INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10043003, /*where_type*/54, /*character_id*/190801, /*face_type*/1, /*character_name*/'花凛', /*description*/'好像有可以领取的报酬\n当前尚未领取\n快确认看看吧！', /*voice_id*/3, /*start_time*/'2022/06/16 12:00:00', /*end_time*/'2022/6/26 14:59:59', /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/2.801, /*change_face_type*/2, /*event_id*/10043);
