INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10050002, /*where_type*/53, /*character_id*/190802, /*face_type*/1, /*character_name*/'花凛', /*description*/'努力完成任务，\n然后领取报酬吧！', /*voice_id*/2, /*start_time*/'2022/09/30 11:00:00', /*end_time*/'2022/10/19 14:59:59', /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/3.099, /*change_face_type*/2, /*event_id*/10050);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10050003, /*where_type*/54, /*character_id*/190802, /*face_type*/1, /*character_name*/'花凛', /*description*/'好像有可以领取的报酬\n当前尚未领取\n快确认看看吧！', /*voice_id*/3, /*start_time*/'2022/09/30 11:00:00', /*end_time*/'2022/10/19 14:59:59', /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/2.801, /*change_face_type*/2, /*event_id*/10050);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10050004, /*where_type*/54, /*character_id*/190802, /*face_type*/2, /*character_name*/'花凛', /*description*/'可以获得报酬哦！\n请关注一下！', /*voice_id*/4, /*start_time*/'2022/09/30 11:00:00', /*end_time*/'2022/10/19 14:59:59', /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/0.0, /*change_face_type*/2, /*event_id*/10050);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10050005, /*where_type*/57, /*character_id*/190802, /*face_type*/1, /*character_name*/'花凛', /*description*/'参与活动辛苦了！\n感谢各位一直以来的\n活跃表现！', /*voice_id*/5, /*start_time*/'2022/09/30 11:00:00', /*end_time*/'2022/10/19 14:59:59', /*pos_x*/-416.5, /*pos_y*/0.0, /*change_face_time*/0.0, /*change_face_type*/1, /*event_id*/10050);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10050006, /*where_type*/55, /*character_id*/190802, /*face_type*/1, /*character_name*/'花凛', /*description*/'这里是公会管理协会！\n如果持有讨伐证，\n可以用来交换报酬哦', /*voice_id*/1, /*start_time*/'2022/09/30 11:00:00', /*end_time*/'2022/10/19 14:59:59', /*pos_x*/-363.0, /*pos_y*/0.0, /*change_face_time*/5.506, /*change_face_type*/2, /*event_id*/10050);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10050007, /*where_type*/55, /*character_id*/190802, /*face_type*/2, /*character_name*/'花凛', /*description*/'辛苦了！\n在这里，可以使用讨伐证\n来交换报酬哦！', /*voice_id*/2, /*start_time*/'2022/09/30 11:00:00', /*end_time*/'2022/10/19 14:59:59', /*pos_x*/-363.0, /*pos_y*/0.0, /*change_face_time*/1.216, /*change_face_type*/1, /*event_id*/10050);
INSERT INTO `event_navi_comment` VALUES (/*comment_id*/10050008, /*where_type*/56, /*character_id*/190802, /*face_type*/2, /*character_name*/'花凛', /*description*/'辛苦了\n请不要忘记，\n用讨伐证交换报酬哦！', /*voice_id*/3, /*start_time*/'2022/09/30 11:00:00', /*end_time*/'2022/10/19 14:59:59', /*pos_x*/-363.0, /*pos_y*/0.0, /*change_face_time*/1.539, /*change_face_type*/1, /*event_id*/10050);
